&lt;p&gt;निम्न प्रश्न में दो कथन और उसके बाद I और II से अंकित दो निष्कर्ष दिए गये हैं। आपको दिए गये कथन को सत्य मानना है, भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों। आपको यह निर्णय करना है कि दिए गए निष्कर्षों में से कौन सा दिए गए कथनों का अनुसरण करता है।&lt;/p&gt;

